import React from "react";
import { Wrapper } from "../style";
import Badge from "@yoru_cha/yoru-ui-react/dist/Badge";
import Icon from "@yoru_cha/yoru-ui-react/dist/Icon";
import Tooltip from "@yoru_cha/yoru-ui-react/dist/Tooltip";
import Button from "@yoru_cha/yoru-ui-react/dist/Button";
import CheckBox from "@yoru_cha/yoru-ui-react/dist/CheckBox";
import Radio from "@yoru_cha/yoru-ui-react/dist/Radio";

export default function TestPage() {
  return (
    <Wrapper>
      <Badge content={99} color="tomato">
        <Icon size="sm">
          <path d="M11.99 2C6.47 2 2 6.48 2 12s4.47 10 9.99 10C17.52 22 22 17.52 22 12S17.52 2 11.99 2zM12 20c-4.42 0-8-3.58-8-8s3.58-8 8-8 8 3.58 8 8-3.58 8-8 8zm.5-13H11v6l5.25 3.15.75-1.23-4.5-2.67z"></path>
        </Icon>
      </Badge>
      <div style={{ margin: "50px 0" }}>
        <Tooltip content="tooltip" direction="right" position="70">
          <Button>click</Button>
        </Tooltip>
      </div>
      <div>
        <CheckBox color="#FF5722"></CheckBox>
      </div>
      <div>
        <Radio color="purple"></Radio>
      </div>
    </Wrapper>
  );
}
